        function title_split($inStr, $length){
            $outArray = array();
            // パラメータチェック
            if ( $length < 1 ) {
                return FALSE;
            }

            for ( $offset = 0; $offset < mb_strlen( $inStr, 'UTF-8' ); $offset += $length ) {
                $outArray[] = mb_substr( $inStr, $offset, $length );
            }

            return $outArray;
        }

